(window.webpackJsonp=window.webpackJsonp||[]).push([[92],{313:function(e){e.exports={data:{posts:{totalCount:82,pageInfo:{totalPages:9,currentPage:5,isFirst:!1,isLast:!1},edges:[{node:{title:"Public Speaking",image:null,path:"/blog/2017/05/30/public-speaking",excerpt:"<p>In my effort to gain human contact, last month I attended the monthly meetup for the Humanist Society of New Zealand. I was apprehensive at first, but it ended up being very enjoyable. I got to have great conversations with intelligent people.</p>\n",date:"2017-05-30T00:00:00.000Z",timeToRead:1}},{node:{title:"Today",image:null,path:"/blog/2017/05/25/today",excerpt:"<p>I feel violently awful today and I don’t know why.</p>\n",date:"2017-05-25T00:00:00.000Z",timeToRead:1}},{node:{title:"Times They Are Changing",image:"/media/images/blog/trump.jpg",path:"/blog/2017/05/24/times-they-are-changing",excerpt:"<p>Things generally devalue with age.</p>\n",date:"2017-05-24T00:00:00.000Z",timeToRead:3}},{node:{title:"I have done",image:"/media/images/blog/PiUnit.jpg",path:"/blog/2017/05/21/i-have-done",excerpt:"<p>For a few years I was into a technology culture that is still growing now – the amateur maker scene. A few fortunate events let me turn this into commissioned work.</p>\n",date:"2017-05-21T00:00:00.000Z",timeToRead:3}},{node:{title:"I eat",image:"/media/images/blog/bmi.jpg",path:"/blog/2017/05/19/i-eat",excerpt:"<p>For a while now I’ve just been skipping meals. When high noon or the evening rolls around I just lack motivation to prepare anything worth eating. Cheap things you can buy ready made are always full of salt and fat. Takeaways in this small town are limited to the main burger chains or a giant deep fried smorgasbord.</p>\n",date:"2017-05-19T00:00:00.000Z",timeToRead:2}},{node:{title:"Suicide",image:null,path:"/blog/2017/05/02/suicide",excerpt:"<p>This is a tough subject, a strong taboo in society. But after watching 13 Reason Why I feel urged to write about my perspective on suicide. I found the show very compelling, the writing is excellent and the characters are very well realised. But the road to taking ones own life can take many forms.</p>\n",date:"2017-05-02T00:00:00.000Z",timeToRead:2}},{node:{title:"A Red Jacket",image:"/media/images/blog/me31.jpg",path:"/blog/2017/04/28/a-red-jacket",excerpt:"<p>Ugh.</p>\n",date:"2017-04-28T00:00:00.000Z",timeToRead:2}},{node:{title:"Modification",image:"/media/images/blog/meclosed.jpg",path:"/blog/2017/04/23/modification",excerpt:"<p>Well, my last blog post was a hit. I guess problems with peoples personal lives are still things that illicit empathy, even on a two-bit blog written by an anti-social introvert like me. So I’ll give it another go.</p>\n",date:"2017-04-23T00:00:00.000Z",timeToRead:3}},{node:{title:"Dating is hard and I am very awkward",image:"/media/images/blog/IMG_20170410_165227.jpg",path:"/blog/2017/04/11/dating-is-hard-and-i-am-very-awkward",excerpt:"<p>I am a very strange and dorky person.</p>\n",date:"2017-04-11T00:00:00.000Z",timeToRead:5}},{node:{title:"Coming Out",image:"/media/images/blog/evolution.jpg",path:"/blog/2016/09/01/coming-out",excerpt:"<p>Would you cooperate and endorse something you knew was not true?</p>\n",date:"2016-09-01T00:00:00.000Z",timeToRead:5}}]}}}}}]);